import React from 'react' ;
import { Link } from 'react-router-dom' ;
import { AppBar, Toolbar, Typography, Button, IconButton, Icon } from '@material-ui/core';
import useStyles from './navbar.styles' ;
import Neia from '../images/Neia.png' ;

const Navbar = () => {
    const classes = useStyles() ;
    return (
        <AppBar  position='static'>
            <Toolbar >
                <IconButton size='large' edge='start' color='inherit' aria-label='logo'>
                <img className={ classes.imgage } src={ Neia } alt='memories' height='60' />
                </IconButton >
                <Typography component={ Link }  to='/'  variant='h2' align='center'> Quoting Your Thoughts </Typography>
                
            </Toolbar>
        </AppBar>
    )
}

export default Navbar ;
